import React from 'react';
import dogCatImage from '../img/dogs.jpg';

const DogDetails = () => {

    const onBark = () => {
        alert('Woof! Woof!');
    }

    return (
        <div className="DogDetails">
            <p>Dog's name</p>
            <img src={dogCatImage} alt=''/>
            <button onClick={onBark}>Bark!</button>
        </div>
    );
}

export default DogDetails;
